// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface CrowdsaleForRetail {
    function joined(address account) external view returns (uint256);
}

interface Relationship {
    struct InviteeInfo {
        address inviterToken;
        address sourceAddress;
    }

    // Report Record the information of all invited personnel
    struct ReportInviteeInfo {
        address token;
        address inviterToken;
        address sourceAddress;
    }

    function isInviter(address account) external view returns (bool);
    function isInvitee(address account) external view returns (bool);
    function getMemberListByInviter(address account) external view returns (address[] memory);
    function getInviterInfoByInvitee(address account) external view returns (InviteeInfo memory);
    function addToInviteeList(address inviteeAccount, address inviterAccount, address sourceAddress) external;
    function addMutliToInviteeList(ReportInviteeInfo[] memory list) external;
}

contract AirdropToRelationship is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event transferToken(address wallet, address account, uint256 amount);

    // address airdrop amount
    mapping(address => uint256) public airdropAmount;

    // Report Record the information of all invited personnel
    struct ReportInviteInfo {
        address token;
        address inviterToken;
        uint256 amount;
    }
    
    Relationship.ReportInviteeInfo[] private _relationshipReportInfo;

    IERC20 public token;
    address public tokenWallet;
    uint256 public minDATBalanceAmount;
    uint256 public minDATStakeAmount;
    uint256 public airdropMinAmount;
    uint256 public airdropMaxAmount;
    address public crowdsaleForRetailAddress;
    IERC20 public crowdsaleToken;
    address public relationshipAddress;

    CrowdsaleForRetail private _crowdsaleForRetailContract;
    Relationship private _relationshipContract;

    bool public checkRelationshipListSwitch = false;
    bool public checkDATBalanceOrDATStakeSwitch = true;
    bool public checkDATBalanceSwitch = false;
    bool public checkDATStakeSwitch = false;
    bool public checkTransferSwitch = false;

    constructor(
        IERC20 _token,
        address _tokenWallet,
        uint256 _minDATBalanceAmount,
        uint256 _minDATStakeAmount,
        uint256 _airdropMinAmount,
        uint256 _airdropMaxAmount,
        address _crowdsaleForRetailAddress,
        IERC20 _crowdsaleToken,
        address _relationshipAddress
    ) Ownable() {
        require(address(_token) != address(0), "Airdrop: The token is the zero address");
        require(_tokenWallet != address(0), "Airdrop: The token wallet is the zero address");
        require(_airdropMinAmount < _airdropMaxAmount, "Airdrop: The minimum airdrop amount must be less than the maximum airdrop amount");

        token = _token;
        tokenWallet = _tokenWallet;
        minDATBalanceAmount = _minDATBalanceAmount;
        minDATStakeAmount = _minDATStakeAmount;
        airdropMinAmount = _airdropMinAmount;
        airdropMaxAmount = _airdropMaxAmount;
        crowdsaleForRetailAddress = _crowdsaleForRetailAddress;
        crowdsaleToken = _crowdsaleToken;
        relationshipAddress = _relationshipAddress;

        _crowdsaleForRetailContract = CrowdsaleForRetail(_crowdsaleForRetailAddress);
        _relationshipContract = Relationship(_relationshipAddress);
    }

    // set minDATBalanceAmount
    function setMinDATBalanceAmount(uint256 amount) public onlyOwner {
        minDATBalanceAmount = amount;
    }
    // set minDATStakeAmount
    function setMinDATStakeAmount(uint256 amount) public onlyOwner {
        minDATStakeAmount = amount;
    }
    // set airdropMinAmount
    function setAirdropMinAmount(uint256 amount) public onlyOwner {
        airdropMinAmount = amount;
    }
    // set airdropMaxAmount
    function setAirdropMaxAmount(uint256 amount) public onlyOwner {
        airdropMaxAmount = amount;
    }
    // open and close checkRelationshipListSwitch
    function openCheckRelationshipListSwitch() public onlyOwner {
        checkRelationshipListSwitch = true;
    }
    function closeCheckRelationshipListSwitch() public onlyOwner {
        checkRelationshipListSwitch = false;
    }
    // open and close checkDATBalanceOrDATStakeSwitch
    function openCheckDATBalanceOrDATStakeSwitch() public onlyOwner {
        checkDATBalanceOrDATStakeSwitch = true;
    }
    function closeCheckDATBalanceOrDATStakeSwitch() public onlyOwner {
        checkDATBalanceOrDATStakeSwitch = false;
    }
    // open and close checkDATBalanceSwitch
    function openCheckDATBalanceSwitch() public onlyOwner {
        checkDATBalanceSwitch = true;
    }
    function closeCheckDATBalanceSwitch() public onlyOwner {
        checkDATBalanceSwitch = false;
    }
    // open and close checkDATStakeSwitch
    function openCheckDATStakeSwitch() public onlyOwner {
        checkDATStakeSwitch = true;
    }
    function closeCheckDATStakeSwitch() public onlyOwner {
        checkDATStakeSwitch = false;
    }
    // open and close checkTransferSwitch
    function openCheckTransferSwitch() public onlyOwner {
        checkTransferSwitch = true;
    }
    function closeCheckTransferSwitch() public onlyOwner {
        checkTransferSwitch = false;
    }

    /**
     * @dev get DAT balance amount of account.
     * @param account the address
     * @return uint256
     */
    function getDatBalance(address account) public onlyOwner view returns (uint256) {
        return crowdsaleToken.balanceOf(account);
    }

    /**
     * @dev get DAT stake amount of account.
     * @param account the address
     * @return uint256
     */
    function getDatStake(address account) public onlyOwner view returns (uint256) {
        return _crowdsaleForRetailContract.joined(account);
    }

    /**
     * @dev get member list from the relationshipList by owner
     */
    function getMemberListByOwner(address account) public onlyOwner view returns (address[] memory) {
        return _relationshipContract.getMemberListByInviter(account);
    }

    /**
     * @dev get member list from the relationshipList by owner
     */
    function getMemberList() public view returns (address[] memory) {
        return _relationshipContract.getMemberListByInviter(msg.sender);
    }

    /**
     * @dev get inviter info from the inviteeList
     */
    function getInviterInfo(address account) public view returns (Relationship.InviteeInfo memory) {
        return _relationshipContract.getInviterInfoByInvitee(account);
    }

    /**
     * @dev Check if an account has this relationshipList.
     * @param account the address of relationshipList
     * @return bool
     */
    function hasRelationshipList(address account) public view returns (bool) {
        require(address(account) != address(0), "Airdrop: The account is the zero address");
        return _relationshipContract.isInviter(account);
    }

    /**
     * @dev Check if an account has this airdroplist.
     * @param account the address
     * @return bool
     */
    function hasAirdropList(address account) public view returns (bool) {
        require(address(account) != address(0), "Airdrop: The account is the zero address");
        return _relationshipContract.isInvitee(account);
    }

    /**
     * @dev Check if an account DAT balance.
     * @param account the address
     * @return bool
     */
    function checkDatBalance(address account) public view returns (bool) {
        uint256 accountBalance = crowdsaleToken.balanceOf(account);
        uint256 formatMinDATBalanceAmount = minDATBalanceAmount * (10**uint256(18));
        return accountBalance >= formatMinDATBalanceAmount;
    }

    /**
     * @dev Check if an account DAT balance.
     * @param account the address
     * @return bool
     */
    function checkDatStake(address account) public view returns (bool) {
        uint256 accountStakeAmount = _crowdsaleForRetailContract.joined(account);
        uint256 formatMinDATStakeAmount = minDATStakeAmount * (10**uint256(18));
        return accountStakeAmount >= formatMinDATStakeAmount;
    }

    /**
     * @dev add mutli account to the relationshipList by owner
     */
    function addMutliToRelationshipList(ReportInviteInfo[] memory list) public onlyOwner {
        require(list.length > 0, "Airdrop: The invite info list is null");
        for (uint i = 0; i < list.length; i++) {
            ReportInviteInfo memory reportInfo = list[i];
            if (
                reportInfo.token != address(0) &&
                reportInfo.inviterToken != reportInfo.token &&
                !hasAirdropList(reportInfo.token) &&
                !hasRelationshipList(reportInfo.token)
            ) {
                airdropAmount[reportInfo.token] = airdropAmount[reportInfo.token].add(reportInfo.amount);
                Relationship.ReportInviteeInfo memory relationshipReportItem = Relationship.ReportInviteeInfo(reportInfo.token, reportInfo.inviterToken, address(this));
                _relationshipReportInfo.push(relationshipReportItem);
            }
        }
        // add data to Relationship Contract
        if (_relationshipReportInfo.length > 0) {
            _relationshipContract.addMutliToInviteeList(_relationshipReportInfo);
        }
    }

    /**
     * @dev add single account to the relationshipList by owner
     */
    function addToRelationshipList(address inviteeAccount, address inviterAccount) public onlyOwner {
        require(inviteeAccount != address(0), "Airdrop: The inviter account is the zero address");
        require(inviterAccount != inviteeAccount, "Airdrop: The inviter account cannot be yourself");
        require(!hasAirdropList(inviteeAccount), "Airdrop: The invitee account is already on the airdropList");
        require(!hasRelationshipList(inviteeAccount), "Airdrop: The invitee account is not in the relationshipList");
        _relationshipContract.addToInviteeList(inviteeAccount, inviterAccount, address(this));
    }

    /**
     * @dev Receive airdrop
     * @param inviterAccount the account of receive's inviter
     */
    function receiveAirdrop(address inviterAccount) public {
        address currentAccount = msg.sender;
        require(inviterAccount != address(0), "Airdrop: The inviter account is the zero address");
        require(inviterAccount != currentAccount, "Airdrop: The inviter account cannot be yourself");
        require(!hasAirdropList(currentAccount), "Airdrop: The invitee account is already on the airdropList");
        require(!hasRelationshipList(currentAccount), "Airdrop: The invitee account is not in the relationshipList");

        if (checkRelationshipListSwitch) {
            require(hasRelationshipList(inviterAccount), "Airdrop: The inviter account is not in the relationshipList");
        }
        if (checkDATBalanceOrDATStakeSwitch) {
            require(checkDatBalance(inviterAccount) || checkDatStake(inviterAccount), "Airdrop: Account does not meet the requirements");
        } else {
            if (checkDATBalanceSwitch) {
                require(checkDatBalance(inviterAccount), "Airdrop: Account balance does not meet the requirements");
            }
            if (checkDATStakeSwitch) {
                require(checkDatStake(inviterAccount), "Airdrop: Stake amount does not meet the requirements");
            }
        }

        // exec receiveAirdrop
        _relationshipContract.addToInviteeList(currentAccount, inviterAccount, address(this));

        // random to airdrop amount
        uint256 actualAmount = _getActualAmount();
        airdropAmount[currentAccount] = airdropAmount[currentAccount].add(actualAmount);
        if (actualAmount > 0) {
            // transfer token to receive account
            token.safeTransferFrom(tokenWallet, currentAccount, actualAmount);
            emit transferToken(tokenWallet, currentAccount, actualAmount);
        }
    }

    /**
     * @dev Get actual amount
     */
    function _getActualAmount() internal view returns(uint256) {
        if (!checkTransferSwitch) {
            return 0;
        }
        // random to airdrop amount
        uint256 randomAmount = _rand(airdropMaxAmount);
        if (randomAmount <= 0) {
            randomAmount = airdropMinAmount;
        } else if (randomAmount > airdropMaxAmount) {
            randomAmount = airdropMaxAmount;
        }
        uint256 actualAmount = randomAmount * (10**uint256(18));
        return actualAmount;
    }

    /**
     * @dev Generate random numbers
     * @param length Random number range
     */
    function _rand(uint256 length) internal view returns(uint256) {
        uint256 random = uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp)));
        return random % length;
    }

    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}

